/*Table structure for table `cmf_asset` */

DROP TABLE IF EXISTS `cmf_asset`;

CREATE TABLE `cmf_asset` (
  `aid` bigint(20) NOT NULL AUTO_INCREMENT,
  `uid` int(11) NOT NULL DEFAULT '0' COMMENT '用户 id',
