  `txcloud_bucket` varchar(255) DEFAULT '' COMMENT '腾讯云存储存储桶',
  `qiniu_accesskey` varchar(255) DEFAULT '' COMMENT '七牛云存储accesskey',
  `qiniu_secretkey` varchar(255) DEFAULT '' COMMENT '七牛云存储secretkey',
  `qiniu_bucket` varchar(255) DEFAULT '' COMMENT '七牛存储桶',
  `qiniu_domain` varchar(255) DEFAULT '' COMMENT '七牛空间域名',
  `qiniu_domain_url` varchar(255) DEFAULT '' COMMENT '七牛云空间绝对地址（app拼链接用）',
  `qiniu_upload_url` varchar(255) DEFAULT '' COMMENT '七牛上传地址,不同区域不一样',
  `comment_weight` decimal(12,2) DEFAULT '0.00' COMMENT '评论权重值',
  `private_letter_nums` int(12) DEFAULT '0' COMMENT '未关注用户时可发送私信条数',
  `private_letter_switch` tinyint(1) DEFAULT '0' COMMENT '未关注可发送消息条数开关 0 关闭 1开启',
  `share_weight` decimal(12,2) DEFAULT '0.00' COMMENT '分享权重值，用于视频推荐',
  `show_val` int(12) DEFAULT '0' COMMENT '用户上传视频初始曝光值',
  `hour_minus_val` int(12) DEFAULT '0' COMMENT '每小时扣除曝光值',
  `video_audit_switch` tinyint(1) DEFAULT '0' COMMENT '视频审核开关 0关闭 1开启',
  `day_ip_limit` int(12) DEFAULT '0' COMMENT '单IP每天限时点赞数',
  `ticket_percent` int(12) DEFAULT '0' COMMENT '票房提现比例',
  `praise_percent` int(12) DEFAULT '0' COMMENT '1票房可兑换票点赞数',
  `draw_min_cash` int(12) DEFAULT '0' COMMENT '最低可提现金额',
  `bonus_min_cash` int(12) DEFAULT '0' COMMENT '分红提现最低金额',
  `reward_tacket` int(12) DEFAULT '0' COMMENT '完整看完一个视频奖励票房数',
  `invite_tacket` int(12) DEFAULT '0' COMMENT '邀请他人双方可获得票房数',
  `iiilab_client` varchar(255) DEFAULT '' COMMENT '自媒体账号',
  `iiilab_key` varchar(255) DEFAULT '' COMMENT '自媒体key',
  `signature` varchar(255) NOT NULL DEFAULT '',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

