, sans-serif, Arial; font-size: 14px; line-height: 26px;\">娜扎助力“画出生命线”公益直播活动，为“芭莎救护车”项目筹集善款献爱心。作为直播首秀，娜扎表示很紧张，但因为是非常有意义的事情，可以帮助到贫困地区的百姓，所以很开心参与这样的公益活动。</span></p><p style=\"text-align: center;\"><span style=\"font-family: 宋体, simsun, sans-serif, Arial; font-size: 14px; line-height: 26px;\"><img src=\"http://qiniudemo.lingdu01.com.com/ueditor_20170601_592f80e55180e.jpg\" title=\"Img467338321.jpg\" alt=\"Img467338321.jpg\"/></span></p><p><span style=\"font-family: 宋体, simsun, sans-serif, Arial; font-size: 14px; line-height: 26px;\"></span></p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; white-space: normal; background-color: rgb(255, 255, 255);\">直播过程中，娜扎一边画出心目中的救护车，一边跟网友交流互动。扎着半丸子头搭配纯白衬衫的娜扎清爽干练，很多网友留言“娜扎太美啦，简单的搭配居然这么好看”。首次在直播间收到这么多礼物，娜扎十分感谢网友的支持与参与，表示获得的所有收益都将转化成真实的救护车，用于改善贫困地区百姓就医和急救条件。据了解，此次公益活动旨在向我国592个国定贫困县（乡）医院捐赠救护车，以待解决我国救护车“预派无车率”高、急救需求量大，现有救护车老化等现象。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; white-space: normal; background-color: rgb(255, 255, 255);\">　　在此次公益活动中，娜扎不仅画出了心目中的救护车，还呼吁更多的人参与到慈善行列中，让爱的救护车驶向更多需要救助的地方。面对直播中带有攻击性的弹幕，娜扎也以自己的方式予以回应，直播金句频出，回答被赞机智霸气，比如“丑吗？丑也忍着看吧，因为这是有意义的事情，希望大家多做好事，帮助那些需要帮助的人”“黑粉，有黑粉吗？我非常爱我的黑粉，因为你们让我变得越来越强大”，心态越来越好的娜扎回应说做的是有意义的事情，即使有黑粉也不能停止。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; white-space: normal; background-color: rgb(255, 255, 255);\">娜扎的善举也得到了许多网友的支持，表示跟着娜扎的脚步做公益很有意义。</p><p><span style=\"font-family: 宋体, simsun, sans-serif, Arial; font-size: 14px; line-height: 26px; background-color: rgb(255, 255, 255);\"><br/></span></p>','娜扎助力公益活动 直播首秀献爱心','',1,1,'2017-03-04 17:36:13',NULL,0,NULL,'',0,'{\"thumb\":\"\"}',0,0,0,0,0,0),(17,1,'','','2017-06-01 11:08:53','<p><span style=\"color: rgb(98, 98, 98); font-family: &#39;Microsoft YaHei&#39;, arial, sans-serif; font-size: 14px; line-height: 24px; background-color: rgb(255, 255, 255);\"></span><img src=\"http://qiniudemo.lingdu01.com.com/ueditor_20170601_592f852b20743.jpg\" title=\"timg (6).jpg\" alt=\"timg (6).jpg\"/></p><h3 style=\"font-size: 24px; margin: 0px 0px 15px; padding: 0px; box-sizing: border-box; border: 0px; line-height: 36px; color: rgb(51, 51, 51); font-weight: normal; font-family: &#39;Microsoft YaHei&#39;, arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">多终端互通直播系统程序</h3><p><span style=\"color: rgb(98, 98, 98); font-family: &#39;Microsoft YaHei&#39;, arial, sans-serif; font-size: 14px; line-height: 24px; background-color: rgb(255, 255, 255);\">云豹直播程序适合电脑、手机、微信等终端直播，并完成了各终端的互通。让用户的产品适合各类不同的终端用户群体需求。而且我们还根据不同用户的需求分出了两个不同版本的系统，传统的秀场模式系统和当下流行的手机全民直播系统为用户提供了产品可选性。</span></p><p><span style=\"color: rgb(98, 98, 98); font-family: &#39;Microsoft YaHei&#39;, arial, sans-serif; font-size: 14px; line-height: 24px; background-color: rgb(255, 255, 255);\"><br/></span></p><p><span style=\"color: rgb(98, 98, 98); font-family: &#39;Microsoft YaHei&#39;, arial, sans-serif; font-size: 14px; line-height: 24px; background-color: rgb(255, 255, 255);\"><br/></span></p><p><span style=\"color: rgb(98, 98, 98); font-family: &#39;Microsoft YaHei&#39;, arial, sans-serif; font-size: 14px; line-height: 24px; background-color: rgb(255, 255, 255);\"><img src=\"http://qiniudemo.lingdu01.com.com/ueditor_20170601_592f88240acb6.jpg\" title=\"timg.jpg\" alt=\"timg.jpg\"/></span></p><p><br/></p><h3 style=\"font-size: 24px; margin: 0px 0px 15px; padding: 0px; box-sizing: border-box; border: 0px; line-height: 36px; color: rgb(51, 51, 51); font-weight: normal; font-family: &#39;Microsoft YaHei&#39;, arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">直播与电商的完美结合</h3><p style=\"margin-top: 0px; margin-bottom: 0px; box-sizing: border-box; padding: 0px; border: 0px; color: rgb(98, 98, 98); font-size: 14px; line-height: 24px; font-family: &#39;Microsoft YaHei&#39;, arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">伴随淘宝推出直播购物，一种新的购物模式悄然兴起，在直播中购买的用户也越来越多，未来阿里还要推出VR购物...云豹直播为您提供成熟的直播购物功能，而且还可以为现有平台程序添加直播购物功能。现有平台支持各类程序，如:Ecshop、Shopns、Shopex、Ecmall ...</p><p><span style=\"color: rgb(98, 98, 98); font-family: &#39;Microsoft YaHei&#39;, arial, sans-serif; font-size: 14px; line-height: 24px; background-color: rgb(255, 255, 255);\"><br/></span></p><p><span style=\"color: rgb(98, 98, 98); font-family: &#39;Microsoft YaHei&#39;, arial, sans-serif; font-size: 14px; line-height: 24px; background-color: rgb(255, 255, 255);\"><br/></span></p><p><span style=\"color: rgb(98, 98, 98); font-family: &#39;Microsoft YaHei&#39;, arial, sans-serif; font-size: 14px; line-height: 24px; background-color: rgb(255, 255, 255);\"><img src=\"http://qiniudemo.lingdu01.com.com/ueditor_20170601_592f84bba97e7.jpg\" title=\"timg (3).jpg\" alt=\"timg (3).jpg\"/></span></p><p><span style=\"color: rgb(98, 98, 98); font-family: &#39;Microsoft YaHei&#39;, arial, sans-serif; font-size: 14px; line-height: 24px; background-color: rgb(255, 255, 255);\"></span></p><h3 style=\"font-size: 24px; margin: 0px 0px 15px; padding: 0px; box-sizing: border-box; border: 0px; line-height: 36px; color: rgb(51, 51, 51); font-weight: normal; font-family: &#39;Microsoft YaHei&#39;, arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">VR全景直播技术服务</h3><p style=\"margin-top: 0px; margin-bottom: 0px; box-sizing: border-box; padding: 0px; border: 0px; color: rgb(98, 98, 98); font-size: 14px; line-height: 24px; font-family: &#39;Microsoft YaHei&#39;, arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">自从投资者们涌入VR这个行业，越来越多的其他行业产品也尝试与VR结合。直播与VR结合的产物就是通过VR设备观看全景现场实况，让直播变得更立体形象。云豹目前已经拥有一套完整的VR直播解决方案，VR直播采用H265编码形式、采用新型播放器实现全景直播效果，同时我们对直播带宽成本也做了最大程度的压缩...</p><p><br/></p><p><br/></p><p><br/></p><p><img src=\"http://qiniudemo.lingdu01.com.com/ueditor_20170601_592f84ca38036.jpg\" title=\"QQ图片20170601110425.jpg\" alt=\"QQ图片20170601110425.jpg\"/></p><p><span style=\"background-color: rgb(255, 255, 255);\"></span></p><h3 style=\"font-size: 24px; margin: 0px 0px 15px; padding: 0px; box-sizing: border-box; border: 0px; line-height: 36px; color: rgb(51, 51, 51); font-weight: normal; font-family: &#39;Microsoft YaHei&#39;, arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">现有网站/APP系统接入直播功能</h3><p style=\"margin-top: 0px; margin-bottom: 0px; box-sizing: border-box; padding: 0px; border: 0px; color: rgb(98, 98, 98); font-size: 14px; line-height: 24px; font-family: &#39;Microsoft YaHei&#39;, arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">云豹为您提供现有程序加入直播功能的技术服务，拥有丰富的对接经验，可以短时间内让您的平台接入直播模块。目前可以接入直播的行业很多：金融、教育、竞拍、体育 ... ，云豹直播模块支持多语言开发接入，并且使用云豹直播自主开发的IM互动系统 ....</p><p><span style=\"background-color: rgb(255, 255, 255);\"><br/></span><br/></p>','云豹直播-优秀的软件和服务商','',1,1,'2017-06-01 10:57:48',NULL,0,NULL,'',0,'{\"thumb\":\"\"}',0,0,0,0,0,0),(18,1,'','','2017-09-22 16:56:07','<p>饿死你让你爸</p>','物权法人','',1,1,'2017-09-22 16:55:59',NULL,0,NULL,'',0,'{\"thumb\":\"\"}',0,0,0,1,0,0),(20,3,'','','2017-09-26 17:04:19','<p style=\"text-align: center\"><img src=\"http://qiniudemo.lingdu01.com.com/ueditor_20170926_59ca180c77880.jpg\" title=\"ber01.jpg\" alt=\"ber01.jpg\"/></p><p><br/></p>','关于云豹网络科技','',1,1,'2017-09-26 17:02:56',NULL,0,NULL,'',0,'{\"thumb\":\"\"}',0,0,0,0,0,0),(21,3,'','','2017-09-26 17:05:19','<p style=\"text-align: center\"><img src=\"http://qiniudemo.lingdu01.com.com/ueditor_20170926_59ca1842b026c.jpg\" title=\"ber02.jpg\" alt=\"ber02.jpg\"/></p><p>运营PC独立游戏产品（Independent Game）、网络游戏发行与游戏虚拟货币发行 、steam游戏运营销售、手机游戏运营开发、APP开发与运营、研发并销售游戏设备如： VR游戏设备、PC游戏手柄设备、手机游戏手柄等</p><p><a style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\" name=\"3\"></a><a style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\" name=\"sub