/*Table structure for table `cmf_praise_list` */

DROP TABLE IF EXISTS `cmf_praise_list`;

CREATE TABLE `cmf_praise_list` (
  `id` int(12) NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `uid` int(12) DEFAULT '0' COMMENT '视频发布者id',
  `ip` bigint(20) DEFAULT '0' COMMENT 'ip',
  `addtime` int(12) DEFAULT '0' COMMENT '添加时间',
  `count` int(12) DEFAULT '0' COMMENT '点赞总数',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `uid ip` (`uid`,`ip`) USING BTREE
