/*Table structure for table `cmf_system_warning` */

DROP TABLE IF EXISTS `cmf_system_warning`;

CREATE TABLE `cmf_system_warning` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `videoid` int(10) DEFAULT '0' COMMENT '视频ID',
  `type` int(2) DEFAULT '0' COMMENT '视频类型：0：短视频；1：方言秀',
  `content` varchar(255) DEFAULT '' COMMENT '警告内容',
  `uid` int(10) DEFAULT '0' COMMENT '视频发布者',
  `addtime` int(10) DEFAULT '0' COMMENT '发布时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT;

