CREATE TABLE `cmf_users_video` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `uid` int(11) DEFAULT '0' COMMENT '用户ID',
  `title` varchar(255) DEFAULT '' COMMENT '标题',
  `thumb` varchar(255) DEFAULT '' COMMENT '封面图片',
  `thumb_s` varchar(255) DEFAULT '' COMMENT '封面小图',
  `href` varchar(255) DEFAULT '' COMMENT '视频地址',
  `likes` int(11) DEFAULT '0' COMMENT '点赞数',
  `views` int(11) DEFAULT '1' COMMENT '浏览数（涉及到推荐排序机制，所以默认为1）',
  `comments` int(11) DEFAULT '0' COMMENT '评论数',
  `steps` int(11) DEFAULT '0' COMMENT '踩总数',
  `shares` int(11) DEFAULT '0' COMMENT '分享数量',
  `addtime` int(11) DEFAULT '0' COMMENT '发布时间',
  `lat` varchar(255) DEFAULT '' COMMENT '维度',
  `lng` varchar(255) DEFAULT '' COMMENT '经度',
  `city` varchar(255) DEFAULT '' COMMENT '城市',
  `isdel` tinyint(1) DEFAULT '0' COMMENT '是否删除 1删除（下架）0不下架',
  `is_urge` int(1) DEFAULT '0' COMMENT '是否催更状态：0：未催更；1：催更中',
  `urge_nums` int(10) DEFAULT '0' COMMENT '催更剩余次数（初始默认：读取对应等级设置的催更次数）',
  `urge_money` int(10) DEFAULT '0' COMMENT '当前视频催更单价（后台统一设置）',
  `big_urgenums` int(10) DEFAULT '0' COMMENT '催更次数最大值：（主播等级表中设置）',
  `status` tinyint(1) DEFAULT '0' COMMENT '视频状态 0未审核 1通过 2拒绝',
  `music_id` int(12) DEFAULT '0' COMMENT '背景音乐ID',
  `xiajia_reason` varchar(255) DEFAULT '' COMMENT '下架原因',
  `show_val` int(12) DEFAULT '0' COMMENT '曝光值',
  `nopass_time` int(12) DEFAULT '0' COMMENT '审核不通过时间（第一次审核不通过时更改此值，用于判断是否发送极光IM）',
  `watch_ok` int(12) DEFAULT '0' COMMENT '视频完整看完次数',
  `cate` int(11) NOT NULL DEFAULT '0' COMMENT '一级分类',
  `subcate` int(11) NOT NULL DEFAULT '0' COMMENT '二级分类',
  `restaurant_id` varchar(255) NOT NULL DEFAULT '' COMMENT '关联餐厅id',
  `restaurant_name` varchar(255) NOT NULL DEFAULT '' COMMENT '关联餐厅名称',
  `topic` varchar(255) NOT NULL DEFAULT '' COMMENT '关联话题',
  PRIMARY KEY (`id`) USING BTREE,
